var book = [];

var add = (word, data) => {
  if (!data) {
    data = book;
  }
  var letter;
  for (letter of word) {
    !data[letter] && (data[letter] = []); 
    data = data[letter];
  }
  data.fin = true;
};

var listChildren = function(string, node){
  var array = [];
  var buildArray = function(currentString, subnode){
    if (subnode.fin) {
      array.push(currentString);
    }
    for (var child in subnode) {
      var newString = currentString + child;
      buildArray(newString, subnode[child]);
    }
    return array;
  };
  return buildArray(string, node);
};

var find = (string, data) => {
  (!data) && (data = book);
  (!string) && (string = ' ');
  for (var letter of string) {
    if (!data[letter]) {
      return ['No names found', ''];
    } else {
      data = data[letter];
    }
  }
  var matchingNames = listChildren(string, data);
  matchingNames.sort();
  var output = [matchingNames.length + ' names total.', ''];
  for (var name in matchingNames) {
    output[1] += matchingNames[name] + ' ';
  }
  return output;
};

var loadNames = function() {
  for(var name of names){
      add(name);
  }
  console.log("ready")
};

loadNames();

